import styled from 'styled-components';

export const Header = styled.header`

  height: 70%;
  width: 100%;
  `;

export const StyledHeaderImage = styled.img`
position: absolute;
z-index: -1;
width: 100%;
  height: 50%;
`;

export const InfoAbout = style.div`
  width: 492px;
  height: 373;
  background: gray
`;
